import { Grid, Typography } from '@material-ui/core';
import React from 'react';

function EachNode(props) {
	return (
		<Grid direction="row" alignItems="center" justify="center">
			<Grid xs="3" direction="row">
				{' '}
				<Typography>Tick</Typography>
			</Grid>
			<Grid xs="6" style={{ background: 'red' }}>
				{' '}
				<Typography>{props.toDo}</Typography>
			</Grid>
			<Grid xs="3">
				{' '}
				<Typography>end</Typography>
			</Grid>
		</Grid>
	);
}

export default EachNode;
